import BoardSquare from "../components/BoardSquare.js"
import Dice from "../components/Dice.js"


export default function Board() {
    let boardArray = [];
    let boardRow = [];
    for (let i = 0; i < 12; i++) {
        for (let j = 0; j < 12; j++) {
            boardRow.push(<div class="boardsquare"><BoardSquare key="${i},${j}"/></div>);
        }
        boardArray.push(boardRow);
        boardRow = [];
    }
    console.log(boardArray);
    return (<div class="board">{boardArray}</div>);
}
